CREATE TABLE `evaluacion_respuesta` (
  `ERE_ID` int(11) NOT NULL,
  `EVA_ID` int(11) NOT NULL,
  `PRE_ID` int(11) NOT NULL COMMENT 'Llave foranea a Pregunta',
  `PRR_ID` int(11) DEFAULT NULL COMMENT 'Llave foranea a Pregunta Respuesta',
  `ERE_OBSERVACIONES` varchar(250) DEFAULT NULL,
  `ERE_IMG_EVIDENCIA` blob,
  `ERE_MIME_TYPE` varchar(255) DEFAULT NULL,
  `ERE_FILE_NAME` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`ERE_ID`),
  KEY `EVA_ID` (`EVA_ID`),
  KEY `PRE_ID` (`PRE_ID`),
  CONSTRAINT `FK_ERE_EVA` FOREIGN KEY (`EVA_ID`) REFERENCES `evaluacion` (`EVA_ID`),
  CONSTRAINT `FK_ERE_PRE` FOREIGN KEY (`PRE_ID`) REFERENCES `pregunta` (`pre_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;
